import React from "react";
import Slider from "react-slick";
import ".sty"

function Slide(){

    const settings = {
        speed: 500,
        slidesToShow: 3,
        slidesToScroll: 3,
        infinite: false,
        row:1,
        slidesPerRow:1,
        responsive: [
            {breakPoint: 992,
            settings:{
                slidesToShow: 3,
                slidesToScroll: 3,
                infinite: true,
                dots:true

            }
            }
        ]
    }
    return(
        <>
            <Slider {...settings}>
                <img src="/images/hamburger-cheese.jpg"/>
                <img src="/images/hamburger-crafters.jpg"/>
                <img src="/images/hamburger-noir.jpg"/>
            </Slider>
        </>
    )
}
export default Slide;
